const initialState = { Delployments: null};




export default  function DeploymentReducer(state=initialState,action)
{
    let newstate = Object.assign({},state)
   switch(action.type)
   {

       case 'ADD':
       {
              return   state.Delployments = action.payload;
           
       }
       case 'LOAD':
       {     return   state.Delployments = action.payload;
        
       }
      default:
        {
          return newstate;
        }
       
   }
}
